import { createBrowserRouter } from "react-router-dom";
import FirstPage from "./UI/View/FirstPage";
import Login from "./UI/View/Login";
import Register from "./UI/View/Register";
import NotFound from "./UI/Error/NotFound";
import UsrPage from "./UI/View/UserMainPage/UsrPage";
import UsrMain from "./UI/View/UserMainPage/UserView/UsrMain";
import UsrPresence from "./UI/View/UserMainPage/UserView/UsrPresence";

const router = createBrowserRouter([
  {
    path: '',
    element: <FirstPage/>,
    children: [
      {
        path: 'login',
        element: <Login/>
      },
      {
        path: 'register',
        element: <Register/>
      }
    ]
  }, {
    path: '/userpage',
    element: <UsrPage/>,
    children: [
      
      {
        path: '',
        element: <UsrMain/>
      },
      {
        path: 'presence',
        element: <UsrPresence/>
      }
    ]
  },
  {
    path: '*',
    element: <NotFound/>
  }
])

export default router
